import React, { Component } from "react";
import { Dropdown,Form } from 'semantic-ui-react'
import Layout from './layout';

class SelectForm extends Component{
state={
    lat:"",
    long:"",
    co:[{
        id:1,
        la:"12.9716",
        lo:"77.5946",
    }]
}
render(){
const cityOptions = [
    {
      key: 'Bangalore',
      text: 'Bangalore',
      value: 1,
    },
  ]
  
  
  handleChange = (e)=>{
    this.setState({
        lat : this.state.co[value].la,
        long : this.state.co[value].lo
    })
 }


  const DropdownExampleSelection = () => (
    <Form>
        <Form.Field>
            <h1>City</h1>
    <Dropdown
      placeholder='Select City'
      fluid
      selection
      onChange={this.handleChange}
      options={cityOptions}
    />
    </Form.Field>
    <Button primary>
          Submit!
        </Button>
    </Form>
  )
}
}
export default DropdownExampleSelection
